def getPositions(array, lower, upper):
	i = 0
	lowerPos = 0
	upperPos = len(array)-1
	
	while True:
		if(array[i] >= lower):
			lowerPos = i
			break
		i+=1


	while True:
		if(array[i] >= upper):
			upperPos = i
			break
		i+=1
		
	return (lowerPos, upperPos)

def boundedMin(positions, arrays):
	minimum = min(arrays[0][positions[0]:positions[1]])
	for array in arrays[1:]:
		tempMin = min(array[positions[0]:positions[1]])
		if tempMin < minimum:
			minimum = tempMin
	return minimum

def boundedMax(positions, arrays):
	maximum = max(arrays[0][positions[0]:positions[1]])
	for array in arrays[1:]:
		tempMax = max(array[positions[0]:positions[1]])
		if tempMax > maximum:
			maximum = tempMax
	return maximum

