print("Error Mínimo & " + apply(min, array, delimiter) + lineDelimiter)
print("Error Máximo & " + apply(max, array, delimiter) +  lineDelimiter)
print("Error Medio & " + apply(np.mean, array, delimiter) + lineDelimiter)
print("Desviación Estándar & " + apply(np.std, array, delimiter) + lineDelimiter)